import Link from 'next/link';
import { GoSearch } from 'react-icons/go';

const linkStyle = {
  fontSize: 35
};



const Header = () => (
  <nav className="navbar navbar-expand-md navbar-dark bg-primary">

    <Link href="/">
      <a className="navbar-brand" style={linkStyle}>Les recettes de Martine</a>
    </Link>

    <ul className="navbar-nav" id="center">
      <li className="nav-item active">
        <Link href="/about">
          <button className="btn btn-success">Ajouter une recette </button>
        </Link>
      </li>
      <li className="nav-item">
        <Link href="/">
          <a className="nav-link" id="recherche"><GoSearch /> Rechercher</a>
        </Link>
      </li>
    </ul>

    <ul className="navbar-nav ml-auto">
      <li className="nav-item">
        <Link href="/">
          <a className="nav-link test">Profil</a>
        </Link>
      </li>
    </ul>

    <style jsx>{`
    #center {
      color: blie;
      background-color: blue;
      position: absolute;
      left: 50%;
      transform: translatex(-50%);
    }
    `}</style>
  </nav>



);


export default Header;
